import React from 'react';
import { Link } from 'react-router-dom';

class AppHeader extends React.Component {
  render() {
    return (
      <div id="app-header" className="slds-box slds-theme_default">
        <h1 id="app-name" className="slds-text-heading_large">
          SFMC Audit Dashboard
        </h1>
      </div>
    );
  }
}

export default AppHeader;
